import PropTypes from 'prop-types';

const Header = ({title}) => {
    return (
        <header>
            <h1>{title}</h1>
        </header>
    )
}

// default property for title
Header.defaultProps = {
    title : 'Task Tracker'
}

// PropTypes
Header.PropTypes = {
    title: PropTypes.string,
}

export default Header
